    h1 { margin-bottom: 10px; }
    label { display: inline-block; margin-right: 15px; cursor: pointer; }
    input[type="checkbox"] { margin-right: 5px; }
    #password {
      margin-top: 10px;
      padding: 6px;
      background: #222;
      color: #eee;
      border: 1px solid #555;
      width: 250px;
      display: block;
    }
    table {
      width: 100%;
      border-collapse: collapse;
      margin-top: 20px;
      font-size: 14px;
    }
    th, td {
      border: 1px solid #333;
      padding: 6px 10px;
      text-align: center;
    }
    th {
      background: #222;
    }
    tr:nth-child(even) {
      background: #1a1a1a;
    }
    tr:hover {
      background: #333;
      cursor: pointer;
    }
    .hidden {
      display: none;
    }

  <div class="info-bar">
    <strong>Filter by category:</strong><br>
    <label><input type="checkbox" value="gps" checked> GPS</label>
    <label><input type="checkbox" value="weather" checked> Weather</label>
    <label><input type="checkbox" value="amateur" checked> Amateur</label>
    <label><input type="checkbox" value="science" checked> Science</label>
  </div>
  <input type="password" id="password" placeholder="Enter password to show unique satellite IDs">
  <table>
    <thead>
      <tr>
        <th>Name</th>
        <th class="sat-id-header hidden">Unique ID</th>
        <th>Group</th>
        <th>NORAD ID</th>
        <th>Latitude (Â°)</th>
        <th>Longitude (Â°)</th>
        <th>Altitude (km)</th>
      </tr>
    </thead>
    <tbody id="satellite-table-body"></tbody>
  </table>
  <script src="https://unpkg.com/satellite.js@4.0.0/dist/satellite.min.js"></script>
  <script>
    const groupUrls = {
      gps: 'https://celestrak.com/NORAD/elements/gp.php?GROUP=gps-ops&FORMAT=tle',
      weather: 'https://celestrak.com/NORAD/elements/gp.php?GROUP=weather&FORMAT=tle',
      amateur: 'https://celestrak.com/NORAD/elements/gp.php?GROUP=amateur&FORMAT=tle',
      science: 'https://celestrak.com/NORAD/elements/gp.php?GROUP=science&FORMAT=tle'
    };

    const tableBody = document.getElementById('satellite-table-body');
    const passwordInput = document.getElementById('password');
    const checkboxes = Array.from(document.querySelectorAll('input[type="checkbox"]'));
    const satIdHeader = document.querySelector('.sat-id-header');

    let satellites = [];
    let showIds = false;
    let expandedSatId = null;

    passwordInput.addEventListener('input', () => {
      showIds = passwordInput.value.trim() === 'thijslodewijk';
      satIdHeader.classList.toggle('hidden', !showIds);
      renderSatellites();
    });

    checkboxes.forEach(cb => cb.addEventListener('change', () => {
      expandedSatId = null;
      renderSatellites();
    }));

    async function fetchTLEs() {
      let index = 0;
      satellites = [];
      for (const [group, url] of Object.entries(groupUrls)) {
        try {
          const res = await fetch(url);
          if (!res.ok) continue;
          const text = await res.text();
          const lines = text.trim().split('\n');
          for (let i = 0; i < lines.length; i += 3) {
            const name = lines[i]?.trim();
            const tle1 = lines[i+1]?.trim();
            const tle2 = lines[i+2]?.trim();
            if (!name || !tle1 || !tle2) continue;
            const satrec = satellite.twoline2satrec(tle1, tle2);
            const noradId = tle1.substring(2, 7).trim();
            const id = `SAT-${String(++index).padStart(4, '0')}`;
            satellites.push({id, name, satrec, group, noradId, lat: null, lng: null, alt: null});
          }
        } catch (e) { console.error(e); }
      }
    }

    function updatePositions() {
      const now = new Date();
      satellites.forEach(sat => {
        const posVel = satellite.propagate(sat.satrec, now);
        if (!posVel.position) return;
        const gmst = satellite.gstime(now);
        const posGd = satellite.eciToGeodetic(posVel.position, gmst);
        sat.lat = satellite.degreesLat(posGd.latitude);
        sat.lng = satellite.degreesLong(posGd.longitude);
        sat.alt = posGd.height * 6371;
      });
    }

    function renderSatellites() {
      const activeGroups = checkboxes.filter(cb => cb.checked).map(cb => cb.value);
      tableBody.innerHTML = '';
      satellites.forEach(sat => {
        if (!activeGroups.includes(sat.group)) return;
        const tr = document.createElement('tr');
        tr.classList.add('sat-row');
        tr.dataset.id = sat.id;
        tr.innerHTML = `
          <td>${sat.name}</td>
          <td class="sat-id-cell ${showIds ? '' : 'hidden'}">${sat.id}</td>
          <td>${sat.group.toUpperCase()}</td>
          <td>${sat.noradId}</td>
          <td>${sat.lat !== null ? sat.lat.toFixed(4) : 'â€”'}</td>
          <td>${sat.lng !== null ? sat.lng.toFixed(4) : 'â€”'}</td>
          <td>${sat.alt !== null ? sat.alt.toFixed(1) : 'â€”'}</td>`;
        tr.addEventListener('click', () => {
          expandedSatId = expandedSatId === sat.id ? null : sat.id;
          renderSatellites();
        });
        tableBody.appendChild(tr);

        if (expandedSatId === sat.id) {
          const expTr = document.createElement('tr');
          expTr.classList.add('expanded-row');
          const expTd = document.createElement('td');
          expTd.classList.add('expanded-cell');
          expTd.colSpan = 7;
          expTd.innerHTML = `
            <strong>Details for ${sat.name} (${sat.id})</strong><br>
            <ul style="list-style: none; padding-left: 0; margin-top: 8px;">
              <li><b>Live GPS:</b> <span class="live-gps" data-id="${sat.id}">${sat.lat?.toFixed(6)}, ${sat.lng?.toFixed(6)}</span></li>
              <li><b>Group:</b> ${sat.group.toUpperCase()}</li>
              <li><b>NORAD ID:</b> ${sat.noradId}</li>
              <li><b>Latitude:</b> ${sat.lat?.toFixed(6)}</li>
              <li><b>Longitude:</b> ${sat.lng?.toFixed(6)}</li>
              <li><b>Altitude:</b> ${sat.alt?.toFixed(2)} km</li>
              <li><b>Inclination:</b> ${sat.satrec?.inclo ? (sat.satrec.inclo * (180 / Math.PI)).toFixed(2) + 'Â°' : 'â€”'}</li>
              <li><b>Eccentricity:</b> ${sat.satrec?.ecco?.toFixed(6) ?? 'â€”'}</li>
              <li><b>Mean Motion:</b> ${sat.satrec?.no_kozai?.toFixed(4) ?? 'â€”'} rev/day</li>
              <li><b>Epoch Year:</b> ${sat.satrec?.epochyr ?? 'â€”'} | Piece: ${sat.satrec?.epnum ?? 'â€”'}</li>
              <li><b>Use:</b> ${sat.group === 'gps' ? 'Navigation' : sat.group === 'weather' ? 'Meteorological Monitoring' : sat.group === 'amateur' ? 'Ham Radio & Experiments' : sat.group === 'science' ? 'Scientific Research' : 'â€”'}</li>
            </ul>`;
          expTr.appendChild(expTd);
          tableBody.appendChild(expTr);
        }
      });
    }

    async function start() {
      await fetchTLEs();
      updatePositions();
      renderSatellites();
      setInterval(() => {
        updatePositions();
        document.querySelectorAll('.live-gps').forEach(el => {
          const sat = satellites.find(s => s.id === el.dataset.id);
          if (sat && sat.lat !== null && sat.lng !== null) {
            el.textContent = `${sat.lat.toFixed(6)}, ${sat.lng.toFixed(6)}`;
          }
        });
        renderSatellites();
      }, 1000);
    }

    start();
